contract CausasBeneficas {

    struct causa {
        uint id;
        string name;
        uint montoObjetivo;
        uint montoRecaudado;
    }

    uint contadorCausas = 0;
    mapping(string => causa) causas;

    function addCausa(string memory _name, uint _montoObjetivo) public {
        contadorCausas += 1;

    }

}

